    {
        fiscalReferenceCreationFromInvoices_BR.addFromInvoiceMap(invoiceMap);
    }

    for (invoiceMap = fiscalDocument_br_vendor_ds.getFirst(1); invoiceMap; invoiceMap =  fiscalDocument_br_vendor_ds.getNext())
    {
        fiscalReferenceCreationFromInvoices_BR.addFromInvoiceMap(invoiceMap);
    }

    for (invoiceMap = fiscalDocument_br_fiscalestablishment_ds.getFirst(1); invoiceMap; invoiceMap =  fiscalDocument_br_fiscalestablishment_ds.getNext())
    {
        fiscalReferenceCreationFromInvoices_BR.addFromInvoiceMap(invoiceMap);
    }

    super();
}

/// <summary>
/// Returns the RecIds of the fiscal documents already referenced.
/// </summary>
/// <returns>String with the recIds to be passed to QueryBuildRange.value method.</returns>
private str getRecIdsAlreadySelected()
{
    TmpFiscalReference_BR tmpFiscalReference = fiscalReferenceCreationFromInvoices_BR.parmTmpFiscalReference();
    str recidsAlreadySelected;

    while select tmpFiscalReference
        where tmpFiscalReference.RefTableId == tableNum(FiscalDocument_BR)
    {
        if (recidsAlreadySelected)
        {
            recidsAlreadySelected += ',';
        }
        recidsAlreadySelected += '!' + int642str(tmpFiscalReference.RefRecId);
    }
    return recidsAlreadySelected;
}

