    return ret;
}

public void executeQuery()
{
    this.query().dataSourceTable(tableNum(FiscalDocument_BR)).addRange(fieldNum(FiscalDocument_BR, FiscalDocumentAccountType)).value(enum2str(CustVendType_BR::Customer));
    this.query().dataSourceTable(tableNum(FiscalDocument_BR)).addRange(fieldNum(FiscalDocument_BR, RecId)).value(element.getRecIdsAlreadySelected());
    this.query().dataSourceTable(tableNum(FiscalDocument_BR)).addRange(fieldNum(FiscalDocument_BR, FiscalEstablishmentCNPJCPF)).value(fiscalReferenceCreationFromInvoices_BR.getFiscalEstablishment().CNPJCPFNum_BR);

    if (fiscalReferenceCreationFromInvoices_BR.parmSourceTableId() == tableNum(SalesComplementaryInvoiceHeader)  ||
        fiscalReferenceCreationFromInvoices_BR.parmSourceTableId() == tableNum(PurchComplementaryInvoiceHeader))
    {
        this.query().dataSourceTable(tableNum(FiscalDocument_BR)).addRange(fieldNum(FiscalDocument_BR, Purpose)).value(enum2str(FiscalDocumentPurpose_BR::Regular));
        this.query().dataSourceTable(tableNum(FiscalDocument_BR)).addRange(fieldNum(FiscalDocument_BR, Purpose)).value(enum2str(FiscalDocumentPurpose_BR::Return));
        this.query().dataSourceTable(tableNum(FiscalDocument_BR)).addRange(fieldNum(FiscalDocument_BR, Status)).value(SysQuery::valueNot(enum2str(FiscalDocumentStatus_BR::Cancelled)));
    }
    super();
}

